  firstName : "Ankit",
  lastName : "Sinha"
}

export function handleLogin(username, password){
  return new Promise((res,rej) =>{
    if(username=="nnnkit" && password == "script"){
      res(user);
    } else {
      rej("User doesnot Exist!");
    }
  })
}
